/*!50001 DROP TABLE IF EXISTS `all_contacts`*/;
/*!50001 DROP VIEW IF EXISTS `all_contacts`*/;
/*!50001 SET @saved_cs_client          = @@character_set_client */;
/*!50001 SET @saved_cs_results         = @@character_set_results */;
/*!50001 SET @saved_col_connection     = @@collation_connection */;
/*!50001 SET character_set_client      = utf8 */;
/*!50001 SET character_set_results     = utf8 */;
/*!50001 SET collation_connection      = utf8_general_ci */;
/*!50001 CREATE ALGORITHM=UNDEFINED */
/*!50013 DEFINER=`root`@`localhost` SQL SECURITY DEFINER */
/*!50001 VIEW `all_contacts` AS (select `users`.`name` AS `name`,`a`.`id` AS `id`,`a`.`user_id` AS `user_id`,`a`.`first_name` AS `first_name`,`a`.`last_name` AS `last_name`,`a`.`address` AS `address`,`a`.`zip` AS `zip`,`a`.`city` AS `city`,`a`.`country_id` AS `country_id`,`a`.`published` AS `published`,`c`.`iso` AS `iso`,`c`.`nicename` AS `country`,`c`.`phonecode` AS `phonecode`,group_concat(distinct `phones`.`phone` separator ',') AS `phones`,group_concat(distinct `emails`.`email` separator ',') AS `emails` from (((`country` `c` left join (`users` left join `contacts` `a` on((`a`.`user_id` = `users`.`id`))) on((`a`.`country_id` = `c`.`id`))) left join `contact_phones` `phones` on((`a`.`id` = `phones`.`contact_id`))) left join `contact_emails` `emails` on((`a`.`id` = `emails`.`contact_id`))) where ((`users`.`active` = 1) and ((`phones`.`published` = 1) or isnull(`phones`.`id`)) and ((`emails`.`published` = 1) or isnull(`emails`.`id`))) group by `a`.`id` order by `a`.`last_name`) */;
/*!50001 SET character_set_client      = @saved_cs_client */;
/*!50001 SET character_set_results     = @saved_cs_results */;
